My absolute favorite winter moisturisers that nourish skin, keep it bouncy soft and glowing without being greasy or goopy. They sit beautifully under makeup and never feel heavy!

@innisfreeindia Green Tea Hyaluronic Acid cream: A great cream for normal-dry skin in a lovely light, wet texture. It floods skin with hydration, keeps it comfortable all day and also gives a soft glow. This actually works all year for me!

@laneige_in Water Bank Cream: I personally love the WB range from Laneige and they have an oily skin variant ie. a gel and a cream for dry skin. This one is quite emollient, very nourishing and comforting.

@belifindia Moisture Bomb: Sister to the OG Aqua Bomb, this too doesn’t fall short in performance. It’s also got this wet hydrating texture so feels very hydrating and goes on light on skin.

@biodermaindia Atoderm Ultra Creme: The OG pharmacy, no-fuss moisturiser. Great texture, generous quantity and so well priced. Excellent for fortifying skin barrier and best for dry, sensitive skin.

@charlottetilbury Magic Cream: Looks thick but it melts like butter and it is truly amazing specially for dry mature skin. It adds a tonne of glow, is excellent as a primer and makes skin slippery soft. 
