It’s the season to GLAM UP and the right lipstick can elevate your look so much. I love high-shine, lustrous nudes because they look elite, super classy and you don’t even need a gloss on top. Just swipe them a few times and get the yummiest lipsss.

All of these are my personal favourites and keep showing up on my profile so high time I curated a list here!

Listing them below:
@maccosmeticsindia Creme in your coffee - a mauve-brown nude in cremesheen finish that works well across skin tones.
@charlottetilbury Nude Romance: this is from their KISSING range. A peachy-nude that runs warm. One of my favourites from CT.
@patmcgrathreal Satinallure lipstick in ‘Negligee’. This is a beige-pink nude that is better for lighter complexions. 
@bobbibrownindia Luxe Shine Intense lipstick in ‘Bare Truth’: one of my old favourites. A stunning mauve-pink that grips lips and offers a great stay along with high lustre of course. 
@yslbeauty Rouge Pur Couture in ‘Nu Muse’: A warm nude-brown shade. Very lightweight on lips and these lipsticks smell so so good.
@charlottetilbury Hollywood Beauty Icon KISSING lipstick in ‘90s Pink’: this is truly a unique pink and I have very few like this. It’s very very pretty.
@esteelauderin Wedding Party Nude Lipstick in ‘Champagne Rose’: A rosy-brown shade that looks so fckn fancy with that glittering bullet! When applied however, it doesn’t look like chunky glitter; just a lot of lustre with great pigment. A very versatile shade that’ll work on almost everyone I feel.
@bobbibrownindia Luxe Shine Intense Lipstick in ‘Bold Honey’: this is a honey toned nude-brown that would suit many complexions.

